/*
Merge event_creature_spawns into creature_spawns and added min/max_build for version population
*/

DROP TABLE IF EXISTS `event_creature_spawns`;

ALTER TABLE `creature_spawns`
ADD COLUMN `event_entry` INT(6) NOT NULL DEFAULT 0 AFTER `phase`,
ADD COLUMN `waypoint_group` INT(6) NOT NULL DEFAULT 0 AFTER `event_entry`,
ADD COLUMN `min_build` INT(6) NOT NULL DEFAULT 12340 AFTER `id`,
ADD COLUMN `max_build` INT(6) NOT NULL DEFAULT 12340 AFTER `min_build`,
DROP PRIMARY KEY,
ADD PRIMARY KEY (`id`,`min_build`),
ADD UNIQUE KEY `unique_index` (`id`,`min_build`) USING BTREE;





